import grad_pic from '../media/grad_pic.jpg';
import asf_pic from '../media/asf_pic.jpeg';
import freeskate_pic from '../media/freeskate_pic.jpg';
import cra_pic from '../media/cra_pic.jpg';

export const news_items = [
  {
    pic: grad_pic,
    year: 2023,
    text_p: <p>Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua.</p>
  },
  {
    pic: asf_pic,
    year: 2023,
    text_p: <p>Congue eu consequat ac felis donec et odio pellentesque diam.</p>
  },
  {
    pic: cra_pic,
    year: 2022,
    text_p: <p>In nibh mauris cursus mattis molestie a iaculis at. Tempor nec feugiat nisl pretium fusce id velit ut tortor.</p>
  },
  {
    pic: freeskate_pic,
    year: 2022,
    text_p: <p>Interviewed by the <a href="https://themuddraker.org/2022/02/12/skate-society/">Muddraker</a> on reviving the HMC Skate Society and bringing <a href="https://www.youtube.com/watch?v=QW5MUFjWts8">freeskating</a> back to campus.</p>
  },
];
